(2,'Pixtron Home Testimonials','pixtron-home-testimonials','<style>#html-body [data-pb-style=S6WJRWL]{text-align:center}</style><div data-content-type=\"html\" data-appearance=\"default\" data-element=\"main\" data-pb-style=\"S6WJRWL\">&lt;div class=\"hb-wrapper testmonial-back above-padding below-padding above-margin below-margin\"&gt;\r\n    &lt;div class=\"page-main\"&gt;\r\n        &lt;div class=\"page-title-main\"&gt;&lt;strong&gt;Members&lt;/strong&gt;&lt;/div&gt;\r\n        &lt;div class=\"hb-row\"&gt;\r\n            &lt;div class=\"hb-testimonoals\"&gt;\r\n                &lt;ul id=\"hb-testimonials\"&gt;\r\n                    &lt;li style=\"display: none;\"&gt;\r\n                        &lt;div class=\"hb-inner\"&gt;\r\n                            &lt;div class=\"hb-content\"&gt;\r\n                                &lt;p&gt;You cant always control who walks into your life but you can control which window you throw them out of.&lt;/p&gt;\r\n                            &lt;/div&gt;\r\n                            &lt;div class=\"hb-image\"&gt;\r\n                                &lt;img style=\"width:200px; height: 200px\" src=\"{{media url=.renditions/wysiwyg/avatar/le1.jpg}}\" alt=\"\" /&gt;\r\n                                     &lt;span&gt;\r\n                                    &lt;h4&gt;Trn Phc Khang&lt;/h4&gt;\r\n                                    &lt;p&gt;Web Designer&lt;/p&gt;\r\n                                &lt;/span&gt;\r\n                            &lt;/div&gt;\r\n                        &lt;/div&gt;\r\n                    &lt;/li&gt;\r\n                    &lt;li style=\"display: none;\"&gt;\r\n                        &lt;div class=\"hb-inner\"&gt;\r\n                            &lt;div class=\"hb-content\"&gt;\r\n                                &lt;p&gt;Peace does not mean one where no noise, no trouble, and no toil. When we are in a storm, we still feel the calm of mind.&lt;/p&gt;\r\n                            &lt;/div&gt;\r\n                            &lt;div class=\"hb-image\"&gt;\r\n                                &lt;img style=\"width:200px; height: 200px\" src=\"{{media url=.renditions/wysiwyg/avatar/kh.jpg}}\" alt=\"\" /&gt;\r\n                                     &lt;span&gt;\r\n                                    &lt;h4&gt;Nguyn Nht L&lt;/h4&gt;\r\n                                    &lt;p&gt;Web Designer&lt;/p&gt;\r\n                                &lt;/span&gt;\r\n                            &lt;/div&gt;\r\n                        &lt;/div&gt;\r\n                    &lt;/li&gt;\r\n                    &lt;li style=\"display: none;\"&gt;\r\n                        &lt;div class=\"hb-inner\"&gt;\r\n                            &lt;div class=\"hb-content\"&gt;\r\n                                &lt;p&gt;Keep your face always toward the sunshine  and shadows will fall behind you.&lt;/p&gt;\r\n                            &lt;/div&gt;\r\n                            &lt;div class=\"hb-image\"&gt;\r\n                                &lt;img style=\"width:200px; height: 200px\" src=\"{{media url=.renditions/wysiwyg/avatar/qu1.jpg}}\" alt=\"\" /&gt;\r\n                                     &lt;span&gt;\r\n                                    &lt;h4&gt;Hong Vn Quyn&lt;/h4&gt;\r\n                                    &lt;p&gt;Game Developer&lt;/p&gt;\r\n                                &lt;/span&gt;\r\n                            &lt;/div&gt;\r\n                        &lt;/div&gt;\r\n                    &lt;/li&gt;\r\n                &lt;/ul&gt;\r\n                &lt;script type=\"text/javascript\" xml=\"space\"&gt;\r\n                    require([\'jquery\', \'pixtronowlcarousel\'], function() {\r\n                        jQuery(document).ready(function() {\r\n                            jQuery(\"#hb-testimonials\").owlCarousel({\r\n                                items: 1,\r\n                                itemsDesktop: [1198, 1],\r\n                                itemsDesktopSmall: [1023, 1],\r\n     