INSERT INTO `magefan_blog_post` VALUES
(1,'Gii thiu LQK Fashion',NULL,'magento 2 blog sample','Magento 2 blog default post.',0,'magento-2-blog-post-sample',NULL,NULL,NULL,NULL,'Magento 2 Blog Post Sample','<div data-content-type=\"html\" data-appearance=\"default\" data-element=\"main\">&lt;!DOCTYPE html&gt;\r\n&lt;html lang=\"vi\"&gt;\r\n\r\n&lt;head&gt;\r\n    &lt;meta charset=\"UTF-8\"&gt;\r\n    &lt;meta name=\"viewport\" content=\"width=device-width, initial-scale=1.0\"&gt;\r\n    &lt;title&gt;Gii Thiu - LQK Fashion&lt;/title&gt;\r\n&lt;/head&gt;\r\n\r\n&lt;body style=\"font-family: Arial, sans-serif; line-height: 1.6; margin: 0; padding: 0; background-color: #f4f4f4;\"&gt;\r\n    &lt;div style=\"width: 100%; margin: auto; overflow: hidden;\"&gt;\r\n        &lt;div style=\"background: #fff; padding: 10px;margin-top: 20px; box-shadow: 0 0 10px rgba(0, 0, 0, 0.1);\"&gt;\r\n            &lt;h2 style=\"color: #333;\"&gt;LQK Fashion - Ni Thi Trang Ta Sng&lt;/h2&gt;\r\n            &lt;p style=\"color: #666; margin-bottom: 15px;\"&gt;Cho mng bn n vi &lt;span style=\"color: #007bff; font-weight: bold;\"&gt;LQK Fashion&lt;/span&gt;, ni mang n cho bn nhng sn phm thi trang p nht v cht lng nht. Chng ti t ho l a ch tin cy cho nhng tn  thi trang yu thch phong cch, s tinh t v s c o.&lt;/p&gt;\r\n            \r\n            &lt;div style=\"margin-bottom: 30px;\"&gt;\r\n                &lt;h3 style=\"color: #333;\"&gt;S Mnh Ca Chng Ti&lt;/h3&gt;\r\n                &lt;p style=\"color: #666; margin-bottom: 15px;\"&gt;Ti &lt;span style=\"color: #007bff; font-weight: bold;\"&gt;LQK Fashion&lt;/span&gt;, s mnh ca chng ti l mang n cho khch hng nhng tri nghim mua sm tuyt vi nht. Chng ti khng ch cung cp nhng sn phm thi trang cht lng m cn ch trng n dch v khch hng hon ho. Chng ti cam kt s khng ngng n lc  em li s hi lng ti a cho bn.&lt;/p&gt;\r\n            &lt;/div&gt;\r\n            \r\n            &lt;div style=\"margin-bottom: 30px;\"&gt;\r\n                &lt;h3 style=\"color: #333;\"&gt;Sn Phm a Dng&lt;/h3&gt;\r\n                &lt;p style=\"color: #666; margin-bottom: 15px;\"&gt;Chng ti cung cp mt lot cc sn phm thi trang t qun o, giy dp n ph kin. Cc b su tp ca chng ti c cp nht lin tc  bt kp xu hng thi trang mi nht trn th gii. Cho d bn ang tm kim phong cch c in, hin i hay ph cch, &lt;span style=\"color: #007bff; font-weight: bold;\"&gt;LQK Fashion&lt;/span&gt; u c th p ng nhu cu ca bn.&lt;/p&gt;\r\n            &lt;/div&gt;\r\n           \r\n            &lt;div style=\"margin-bottom: 30px;\"&gt;\r\n                &lt;h3 style=\"color: #333;\"&gt;Cam Kt Cht Lng&lt;/h3&gt;\r\n                &lt;p style=\"color: #666; margin-bottom: 15px;\"&gt;Chng ti cam kt ch cung cp nhng sn phm c cht lng tt nht. Mi sn phm ti &lt;span style=\"color: #007bff; font-weight: bold;\"&gt;LQK Fashion&lt;/span&gt; u tri qua quy trnh kim tra cht lng nghim ngt trc khi n tay khch hng. Chng ti lun m bo rng bn s hi lng vi mi sn phm m bn la chn.&lt;/p&gt;\r\n            &lt;/div&gt;\r\n            \r\n            &lt;h3 style=\"color: #333;\"&gt;Hy n Vi Chng Ti&lt;/h3&gt;\r\n            &lt;p style=\"color: #666; margin-bottom: 15px;\"&gt;Chng ti lun cho n bn n vi &lt;span style=\"color: #007bff; font-weight: bold;\"&gt;LQK Fashion&lt;/span&gt;  tri nghim s khc bit. Hy  chng ti gip bn ta sng v th hin phong cch ca ring mnh. Cm n bn  tin tng v la chn &lt;span style=\"color: #007bff; font-weight: bold;\"&gt;LQK Fashion&lt;/span&gt;.&lt;/p&gt;\r\n        &lt;/div&gt;\r\n    &lt;/div&gt;\r\n&lt;/body&gt;\r\n\r\n&lt;/html&gt;\r\n</div>','2024-06-26 04:00:48','2024-06-27 03:29:02','2024-06-26 00:00:00',1,1,0,'magefan_blog/LQK_LOGO.png',NULL,2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,20,0,NULL,'<div data-content-type=\"html\" data-appearance=\"default\" data-element=\"main\">&lt;div&gt;&lt;p&gt;LQK Fashion - Ni Thi Trang Ta Sng&lt;/p&gt;&lt;div&gt;\r\n&lt;div&gt;&lt;p&gt;Cho mng bn n vi &lt;span style=\"color: #007bff; font-weight: bold;\"&gt;LQK Fashion&lt;/span&gt;, ni mang n cho bn nhng sn phm thi trang p nht v cht lng nht. Chng ti t ho l a ch tin cy cho nhng tn  thi trang yu thch phong cch, s tinh t v s c o.&lt;/p&gt;&lt;div&gt;</div>',2),
