gt;\r\n            &lt;h1&gt;Hng Dn Phi &lt;/h1&gt;\r\n            &lt;p&gt;T tin th hin phong cch c nhn vi cc mo phi  thng minh&lt;/p&gt;\r\n        &lt;/div&gt;\r\n    &lt;/header&gt;\r\n\r\n    &lt;div class=\"container\"&gt;\r\n        &lt;div class=\"main\"&gt;\r\n            &lt;h2&gt;1. Phi  Cho Mi Trng Cng S&lt;/h2&gt;\r\n            &lt;img src=\"https://images.unsplash.com/photo-1563941401-8740df60cb54\" alt=\"Phi  Cng S\"&gt;\r\n            &lt;p&gt;Trang phc cng s khng ch cn lch s m cn phi thoi mi v th hin s chuyn nghip. Hy bt u vi nhng mn  c bn nh o s mi trng, qun ty hoc chn vy bt ch. Kt hp chng vi mt chic o blazer  thm phn trang trng. ng qun chn giy v ph kin nh ng h hoc ti xch  hon thin b trang phc.&lt;/p&gt;\r\n            &lt;p&gt;Nu bn mun to thm im nhn, hy th phi  vi cc mu sc ti sng hoc ha tit nh nhng. Chng hn, mt chic khn qung c mu pastel c th lm cho trang phc tr nn ni bt hn m vn gi c v thanh lch.&lt;/p&gt;\r\n\r\n            &lt;h2&gt;2. Trang Phc Th Thao Phong Cch&lt;/h2&gt;\r\n            &lt;img src=\"https://images.unsplash.com/photo-1562060627-f99e0b6eb335\" alt=\"Trang Phc Th Thao\"&gt;\r\n            &lt;p&gt;Phong cch th thao khng ch dnh cho phng gym m cn rt ph hp cho cc hot ng hng ngy. Hy th kt hp qun leggings vi o thun dng rng v mt i giy th thao. Bn c th thm mt chic o khoc bomber  to thm s nng ng v thoi mi.&lt;/p&gt;\r\n            &lt;p&gt;ng ngi th cc mu sc ni bt hoc ha tit c tnh. Cc ph kin nh m li trai hay ba l nh cng gip bn trng phong cch v tin li hn trong cc hot ng ngoi tri.&lt;/p&gt;\r\n\r\n            &lt;h2&gt;3. Phi  Do Ph Cui Tun&lt;/h2&gt;\r\n            &lt;img src=\"https://images.unsplash.com/photo-1592437182481-3c3038b497c2\" alt=\"Phi  Do Ph\"&gt;\r\n            &lt;p&gt;Cui tun l thi gian  th gin v tn hng, v vy hy chn nhng b trang phc thoi mi nhng vn thi trang. Mt chic vy maxi thong mt hoc qun short kt hp vi o thun s l la chn l tng cho nhng bui do ph.&lt;/p&gt;\r\n            &lt;p&gt;Kt hp trang phc vi giy dp thoi mi nh sandals hoc sneakers v thm mt chic m rng vnh  bo v bn khi nng. Ph kin nh knh rm v ti tote cng l nhng la chn tuyt vi  hon thin phong cch do ph.&lt;/p&gt;\r\n\r\n            &lt;h2&gt;4. \r\n</div>','2024-06-26 15:08:20','2024-06-26 18:10:48','2024-06-26 00:00:00',0,1,0,NULL,NULL,2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,NULL,NULL,NULL),
(5,'Tng hp 4 gam mu xanh hot nht h 2024 dnh cho Qu c',NULL,NULL,NULL,0,'quan-culottes--item-danh-cho-quy-co-hien-dai',NULL,NULL,NULL,NULL,NULL,'<div data-content-type=\"html\" data-appearance=\"default\" data-element=\"main\">&lt;!DOCTYPE html&gt;\r\n&lt;html lang=\"vi\"&gt;\r\n\r\n&lt;head&gt;\r\n    &lt;meta charset=\"UTF-8\"&gt;\r\n    &lt;meta name=\"viewport\" content=\"width=device-width, initial-scale=1.0\"&gt;\r\n    &lt;title&gt;Phong Cch Thi Trang - Xu Hng Ma H&lt;/title&gt;\r\n    &lt;style&gt;\r\n        .blog-container h3 {\r\n             font-size:1.6em\r\n        }\r\n        .blog-container span {\r\n             font-size:1.2em\r\n        }\r\n        .blog-container img {\r\n             max-width: 47%;\r\n             height: auto;\r\n        }\r\n    &lt;/style&gt;\r\n&lt;/head&gt;\r\n\r\n&lt;body style=\"font-family: Arial, sans-serif; line-height: 1.6; margin: 0; padding: 0; background-color: None\"&gt;\r\n    &lt;div class=\"blog-container\" style=\"width: 100%; margin: auto; overflow: hidden;\"&gt;\r\n        &lt;div class=\"main\" style=\"margin-top: 10px;\"&gt;\r\n            &lt;h3 style=\"color: #333;\"&gt;Xanh Cerulean  mu sc ca bu tri thanh bnh&lt;/h3&gt;\r\n            &lt;span style=\"color: #666; margin-bottom: 15px;\"&gt;Theo Vin Mu Sc Pantone, mu xanh Cerulean c nh ngha l mu sc ca bu tri vo nhng ngy nng thanh bnh, trong vt. Trong mt bi bo c trch dn, Pantone cng ch ra rng Cerulean l gam mu mang n ngun cm hng cho s sng to v kho lo trong Xun H 2024.&lt;/span&gt;\r\n            &lt;span style=\"color: #666; margin-bottom: 15px;\"&gt;V vy, nhng trang phc vi gam mu Cerulean lm ch o s mang n cho ngi mc s ti sng, t tin v trn y hng khi, to nn mt khi u mi y nng lng trong ma H ny.&lt;/span&gt;\r\n            \r\n            &lt;h3 style=\"color: #333;\"&gt;Xanh mint  Mu sc ca thanh xun trong tro&lt;/h3&gt;\r\n            &lt;span style=\"color: #666; margin-bottom: 15px;\"&gt;Xanh mint  gam mu ca v p trong tro v tinh khi. Trang phc vi gam mu ny gi ln s ti mi v thanh xun. Bn cnh , sc xanh mint cn biu trng cho s on t v vin mn, mang n mt cu chuyn thanh xun trn vn.&lt;/span&gt;&lt;br&gt;\r\n            &lt;div class=\"image-column\" style=\"display: flex; flex-direction: row; align-items: center;justify-content: space-between;background: #fff\"&gt;\r\n            &lt;img src=\"{{media url=.renditions/wysiwyg/blog/4/3.png}}\" alt=\"\" style=\"max-width: 45%; height: auto;\"/&gt;\r\n            &lt;img src=\"{{media url=.renditions/wysiwyg/blog/4/2.png}}\" alt=\"\" style=\"max-width: 45%; height: auto;\"/&gt;\r\n            &lt;/div&gt;\r\n            &lt;br&gt;\r\n            &lt;span style=\"color: #666; margin-bottom: 15px;\"&gt;Gam mu ny cc k ph bin v thnh cng trong cc thit k thi trang, nhn mnh vo sc sng ti mi v s ph cch ca ngi mc. Trong nhng ngy u ma rc r, trang phc xanh mint s to im nhn c bit cho cc nng, gip h ta sng v thu ht mi nh nhn.&lt;/span&gt;\r\n            \r\n            &lt;h3 style=\"color: #333;\"&gt;Xanh Navy  gam mu ca s th gin thoi mi nht&lt;/h3&gt;\r\n            &lt;span style=\"color: #666; margin-bottom: 15px;\"&gt;Gam mu xanh navy d gi n khng gian i dng su thm v s chim nghim. y l gam mu rt c cc tn  thi trang yu thch bi s linh hot v d tnh. Bn c th d dng kt hp xanh navy vi cc mu sc khc nh , cam, vng, thm ch l tm. Theo nghin cu ca G.F. Smith, mu xanh navy mang n s th gin thoi mi nht. V vy, y l la chn tuyt vi  lm cho ngy h ca bn thm n tng.&lt;/span&gt;&lt;br&gt;\r\n            &lt;div class=\"image-column\" style=\"display: flex; flex-direction: row; align-items: center;justify-content: space-between;background: #fff\"&gt;\r\n            &lt;img src=\"{{media url=.renditions/wysiwyg/blog/4/4.jpeg}}\" alt=\"\" style=\"max-width: 45%; height: auto;\"/&gt;\r\n            &lt;img src=\"{{media url=.renditions/wysiwyg/blog/4/4.jpeg}}\" alt=\"\" style=\"max-width: 45%; height: auto;\"/&gt;\r\n            &lt;/div&gt;\r\n            &lt;br&gt;\r\n            &lt;span style=\"color: #666; margin-bottom: 15px;\"&gt;c bit, xanh navy thuc gam mu xanh trm, gip cc nng c th hack dng cc hiu qu vi trang phc mang mu sc ny.&lt;/span&gt;\r\n            \r\n            &lt;h3 style=\"color: #333;\"&gt;Xanh lc m  gam mu ca sc sng ca cy c hoa l&lt;/h3&gt;\r\n            &lt;span style=\"color: #666; margin-bottom: 15px;\"&gt;C rt nhiu la chn trang phc vi gam mu ny trong nhng ngy h y nng. V v p tinh khi trong tro ca cy c hoa l gip mang li cho ngi mc nt p n tng. Tng trng s pht trin, mang li cm gic an ton cho ngi mc cng nh ngi xung quanh. V vy, trang phc vi gam mu ny mang n cho nng ngun cm hng v tn trong nhng ngy h.&lt;/span&gt;&lt;br&gt;\r\n            &lt;div class=\"image-column\" style=\"display: flex; flex-direction: row; align-items: center;justify-content: space-between;background: #fff\"&gt;\r\n            &lt;img src=\"{{media url=.renditions/wysiwyg/blog/4/5.png}}\" alt=\"\" style=\"max-width: 45%; height: auto;\"/&gt;\r\n            &lt;img src=\"{{media url=.renditions/wysiwyg/blog/4/6.png}}\" alt=\"\" style=\"max-width: 45%; height: auto;\"/&gt;\r\n            &lt;/div&gt;\r\n        &lt;/div&gt;\r\n    &lt;/div&gt;\r\n\r\n&lt;/body&gt;\r\n\r\n&lt;/html&gt;</div>','2024-06-26 20:33:00','2024-06-27 03:52:30','2024-06-26 00:00:00',1,1,0,'magefan_blog/1.png',NULL,2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,38,0,NULL,'<div data-content-type=\"html\" data-appearance=\"default\" data-element=\"main\">&lt;p&gt;Nhc n gam mu ca ngy h th chc chn khng th k n gam mu xanh ngt ngo,  trong tro,  mnh lit v  n tng. Mi sc xanh khc nhau t sc mu ca bu tri, n c nhng mu ca bin c hay gam mu xanh lc ca thin nhin, u mang nhng  ngha v ngun cm hng ring trong mi b trang phc.&lt;/p&gt;</div>',NULL),
(6,'Trang phc cho nhng chuyn i d ngoi ma h 2024',NULL,NULL,NULL,0,'trang-phuc-cho-nhung-chuyen-di-da-ngoai-mua-he-2024',NULL,NULL,NULL,NULL,NULL,'<div data-content-type=\"html\" data-appearance=\"default\" data-element=\"main\">&lt;!DOCTYPE html&gt;\r\n&lt;html lang=\"vi\"&gt;\r\n\r\n&lt;head&gt;\r\n    &lt;meta charset=\"UTF-8\"&gt;\r\n    &lt;meta name=\"viewport\" content=\"width=device-width, initial-scale=1.0\"&gt;\r\n    &lt;title&gt;Trang phc cho nhng chuyn i d ngoi ma h 2024&lt;/title&gt;\r\n    &lt;style&gt;\r\n        .blog-container h3 {\r\n             font-size:1.6em\r\n        }\r\n        .blog-container span {\r\n             font-size:1.2em\r\n        }\r\n        .blog-container img {\r\n             max-width: 47%;\r\n             height: auto;\r\n        }\r\n    &lt;/style&gt;\r\n&lt;/head&gt;\r\n\r\n&lt;body style=\"font-family: Arial, sans-serif; line-height: 1.6; margin: 0; padding: 0;\"&gt;\r\n    &lt;div class=\"blog-container\" style=\"width: 100%; margin: auto; overflow: hidden;\"&gt;\r\n        &lt;div class=\"main\" style=\"margin-top: 10px;\"&gt;\r\n            &lt;h3 style=\"color: #333;\"&gt;Phong cch Cottagecore nh nhng trong nhng thit k m&lt;/h3&gt;\r\n            &lt;span style=\"color: #666; margin-bottom: 15px;\"&gt;Phong cch Cottagecore l xu hng thi trang  c cc Qu c yu thch v la chn rt nhiu. Phong cch thi trang ny to c cm gic v s bnh yn, trong tro v nh nhng. Do vy, im nhn  cc chi tit hay kiu dng nh nhng ca trang phc thuc phong cch thi trang ny thng c la chn cc gam mu thin nhin du nh nh mu pastel, mu nu hoc mu be,&lt;/span&gt;&lt;br&gt;&lt;br&gt;\r\n            &lt;span style=\"color: #666; margin-bottom: 15px;\"&gt;c bit, cc thit k m lin vi phn chn vy xe chc chn l ngi cng s tuyt vi gip cc nng c th c c nhng bc nh ng  cho chuyn i chi. Mt bt m nh cho nng l c th u tin ha tit hoa nh tr trung, hin i v cc trending cho ngi mc.&lt;/span&gt;&lt;br&gt;&lt;br&gt;\r\n            &lt;span style=\"color: #666; margin-bottom: 15px;\"&gt;Ngoi r